  docBrowse(event) {
    event.preventDefault();
    $('#loader_img').show(); // $('.fullpageloader').show();

    var name = event.target.name;
    var uploadedfiles = [];

    if (event.currentTarget.files && event.currentTarget.files[0]) {
      for (var i = 0; i < event.currentTarget.files.length; i++) {
        var file = event.currentTarget.files[i];

        if (file) {
          var fileName = file.name;
          var ext = fileName.split('.').pop();

          if (ext === "jpg" || ext === "png" || ext === "jpeg" || ext === "pdf" || ext === "JPG" || ext === "PNG" || ext === "JPEG" || ext === "PDF") {
            var objTitle = {
              fileInfo: file
            };
            uploadedfiles.push(objTitle);
          } else {
            swal("Allowed file formats are jpg, png, jpeg, pdf");
          } //file types

        } //file
        else {
            swal("Files not uploaded");
          } //file

      } //for 


      if (event.currentTarget.files) {
        this.setState({
          ["gotImage" + name]: true
        });
        main().then(formValues => {
          var docBrowsearr = []; // var docBrowsearr = this.state[name];

          for (var k = 0; k < formValues.length; k++) {
            docBrowsearr.push(formValues[k].imgUrl);
          }

          this.setState({
            [name]: docBrowsearr,
            documentArray: docBrowsearr // docBrowse : true,

          }, () => {});
        });

        async function main() {
          var formValues = [];

          for (var j = 0; j < uploadedfiles.length; j++) {
            var config = await getConfig();
            var s3url = await s3upload(uploadedfiles[j].fileInfo, config, this);
            const documentProof = {
              "imgUrl": s3url,
              "status": "New",
              "remark": "",
              "createdBy": localStorage.getItem("user_ID"),
              "createdAt": new Date()
            };
            formValues.push(documentProof);
          }

          return Promise.resolve(formValues);
        }

        function s3upload(image, configuration) {
          return new Promise(function (resolve, reject) {
            S3FileUpload.uploadFile(image, configuration).then(Data => {
              resolve(Data.location);
            }).catch(error => {});
          });
        }

        function getConfig() {
          return new Promise(function (resolve, reject) {
            axios.get('/api/projectsettings/get/S3').then(response => {
              $('#loader_img').hide(); // console.log("response.data Img==>",response.data);

              const config = {
                bucketName: response.data.bucket,
                dirName: 'propertiesImages',
                region: response.data.region,
                accessKeyId: response.data.key,
                secretAccessKey: response.data.secret
              };
              resolve(config);
            }).catch(function (error) {});
          });
        }
      }
    }
  }

