        if (file) {
          var fileName = file.name;
          var ext = fileName.split('.').pop();

          if (ext === "jpg" || ext === "png" || ext === "jpeg" || ext === "JPG" || ext === "PNG" || ext === "JPEG") {
            if (file) {
              var objTitle = {
                fileInfo: file
              };
              imgBrowse.push(objTitle); //console.log('imgBrowse',imgBrowse);
            } else {
              swal(" ", "Files not uploaded");
            } //file

          } else {
            swal(" ", "Allowed images formats are (jpg,png,jpeg)");
          } //file types

        } //file

      } //for 


      if (event.currentTarget.files) {
        main().then(formValues => {
          var imgBrowse = this.state[name];

          for (var k = 0; k < formValues.length; k++) {
            imgBrowse.push(formValues[k].imgBrowse);
          }

          this.setState({
            [name]: imgBrowse,
            imgBrowse: true
          });
        });

        async function main() {
          var name = event.target.name;
          var formValues = [];

          for (var j = 0; j < imgBrowse.length; j++) {
            var config = await getConfig();
            var s3url = await s3upload(imgBrowse[j].fileInfo, config, this);
            const formValue = {
              "imgBrowse": s3url,
              "status": "New"
            };
            formValues.push(formValue);
          }

          return Promise.resolve(formValues);
        }

        function s3upload(image, configuration) {
          return new Promise(function (resolve, reject) {
            S3FileUpload.uploadFile(image, configuration).then(Data => {
              resolve(Data.location);
            }).catch(error => {});
          });
        }

        function getConfig() {
          return new Promise(function (resolve, reject) {
            axios.get('/api/projectsettings/get/S3').then(response => {
              const config = {
                bucketName: response.data.bucket,
                dirName: 'propertiesImages',
                region: response.data.region,
                accessKeyId: response.data.key,
                secretAccessKey: response.data.secret
              };
              resolve(config);
            }).catch(function (error) {});
          });
        }
      }
    }
  }

