              return new Promise(function (resolve, reject) {
                S3FileUpload
                  .uploadFile(image, configuration)
                  .then((Data) => {
                    resolve(Data.location);
                  })
                  .catch((error) => {
                  })
              })
            }
            function getConfig() {
              return new Promise(function (resolve, reject) {
                axios
                  .get('/api/projectsettings/get/S3')
                  .then((response) => {
                    $('#loader_img').hide();
                    // console.log("response.data Img==>",response.data);

